import React from 'react';
import { StyleSheet, Text, View, TextInput } from 'react-native';

const styles = StyleSheet.create({
	container: {
		backgroundColor: '#fff',
	},
	appbar: {
		backgroundColor: '#58e',
		padding: 30
	},
	title: {
		fontSize: 30,
		fontWeight: "bold",
		color: "white"
	},
	item: {
		padding: 25,
		borderBottomColor: '#ccc',
		borderBottomWidth: 1
	},
	itemText: {
		fontSize: 25
	},
	input: { 
		height: 40, 
		borderColor: 'gray',
		backgroundColor: '#ffd',
		padding: 20,
		borderWidth: 1,
		fontSize: 30
	}
});

function App() {
	return (
		<View style={styles.container}>
			<View style={styles.appbar}>
				<Text style={styles.title}>Native Toto</Text>
			</View>
			<View style={styles.list}>
				<View style={styles.item}>
					<Text style={styles.itemText}>Item One</Text>
				</View>
				<View style={styles.item}>
					<Text style={styles.itemText}>Item Two</Text>
				</View>
				<View style={styles.item}>
					<Text style={styles.itemText}>Item Three</Text>
				</View>
				<View style={styles.item}>
					<Text style={styles.itemText}>Item Four</Text>
				</View>
			</View>
			<View>
				<TextInput style={styles.input} />
			</View>
		</View>
	);
}

export default App;
